  [],\n\t\"revision_timestamp\": \"2016-07-27T22:51:29.760837\",\n\t\"name\": \"agassiz-national-wildlife-refuge-annual-narrative-report-calendar-year-1981\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Agassiz
  NWR outlines Refuge accomplishments during the 1981 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the master plan,
  public participation, compliance with environmental and cultural resource mandates,
  and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, manpower programs, funding, safety, and technical
  assistance is given. Habitat management is also covered; subjects include wetlands,
  forests, croplands, grasslands, haying, fire management, pest control, and wilderness
  areas. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, animal control, and marking and bird banding. The public uses of the
  Refuge described in this report include outdoor classrooms, interpretive programs,
  hunting, trapping, and law enforcement. The equipment and facilities section of
  the report provides information about new construction, rehabilitation, equipment
  replacement, and energy conservation. Cooperative programs are provided at the end.
  Refuge brochures, newspaper articles, and field guides are attached.\",\n\t\"license_title\":
